// Steps data generator
function getSteps(t: Translations) {
  return [
    {
      id: 1,
      title: t.howItWorks.steps['1']?.title ?? '',
      description: t.howItWorks.steps['1']?.description ?? '',
    },
    {
      id: 2,
      title: t.howItWorks.steps['2']?.title ?? '',
      description: t.howItWorks.steps['2']?.description ?? '',
    },
    {
      id: 3,
      title: t.howItWorks.steps['3']?.title ?? '',
      description: t.howItWorks.steps['3']?.description ?? '',
    },
    {
      id: 4,
      title: t.howItWorks.steps['4']?.title ?? '',
      description: t.howItWorks.steps['4']?.description ?? '',
    },
  ];
}

/**
 * HowItWorksSection - Step-by-step guide with vertical timeline
 */

export function HowItWorksSection() {
  const containerRef = useRef<HTMLDivElement>(null);
  const { scrollYProgress } = useScroll({
    target: containerRef,
    offset: ['start center', 'end center'],
  });
  const { t } = useLanguageStore();
  const steps = getSteps(t);

  return (
    <section ref={containerRef} className="bg-background relative overflow-hidden py-20">
      <PageGradient />
      <div className="relative z-10 mx-auto max-w-6xl px-4 lg:px-8">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.5 }}
          className="mb-20 text-center"
        >
          <h2 className="text-foreground mb-4 font-mono text-2xl font-bold tracking-tight sm:text-3xl md:text-4xl">
            {t.howItWorks.title}
          </h2>
          <p className="text-muted-foreground mx-auto max-w-xl font-mono text-sm tracking-wide">
            {t.howItWorks.subtitle}
          </p>
        </motion.div>

        <div className="grid gap-8 md:grid-cols-2 lg:gap-12">
          {/* Timeline Container */}
          <div className="relative pl-8 md:pl-0">
            {/* Vertical Timeline Line - Left Aligned */}
            <div className="absolute top-0 left-0 hidden h-full w-[2px] bg-white/10 md:left-[3px] md:block">
              {/* Progress Fill */}
              <motion.div
                className="w-full origin-top bg-white"
                style={{ scaleY: scrollYProgress }}
              />
            </div>

            {/* Steps List */}
            <ol className="relative space-y-16 md:space-y-24">
              {steps.map((step, index) => (
                <motion.li
                  key={step.id}
                  className="relative flex flex-col items-center gap-8 md:flex-row md:gap-16 md:pl-12"
                  initial={{ opacity: 0, x: -20 }}
                  whileInView={{ opacity: 1, x: 0 }}
                  viewport={{ once: true, margin: '-100px' }}
                  transition={{ duration: 0.5, delay: index * 0.1 }}
                >
                  {/* Timeline Dot (Mobile only, or adjust logic if needed for desktop) */}
                  <div className="absolute top-2 left-[-33px] hidden h-2 w-2 rounded-full bg-white ring-4 ring-black md:block" />

                  {/* Text Content */}
                  <div className="flex-1 text-left">
                    <h3 className="mb-4 flex items-baseline gap-3 font-mono text-xl font-bold text-white md:text-2xl">
                      <span className="text-white/60">{step.id}.</span>
                      {step.title}
                    </h3>
                    <p className="text-muted-foreground max-w-xl font-mono text-sm leading-relaxed">
                      {step.description}
                    </p>
                  </div>
                </motion.li>
              ))}
            </ol>
          </div>

          <div className="flex items-center justify-center">
            <HowItWorksIllustration />
          </div>
        </div>
      </div>
    </section>
  );
}
